import React from "react";
import "../stylesheets/Club.scss";

const Club = () => {
  return (
    <li className="list__item">
      <i className="item__icon" />{" "}
      <h1 className=" item__title">Nombre del grupo</h1>{" "}
      <p item__members> Members: Fulanita, Menganita</p>
    </li>
  );
};

export default Club;
